// Dependencies.
import React from 'react';

// Component 'TopScroll'.
function TopScroll() {
    return (
        // TopScroll Container.
        <>
            <a href="#LandingPage" class="TopScroll hvr-icon-up">
                Icon Up <i class="fa fa-arrow-circle-o-up hvr-icon"></i>
            </a>
        </>
    );
}

// Do export.
export default TopScroll;
